import { Divider } from "@material-ui/core";
import React from "react";
import axios from 'axios';



export function ListApplications( {
    props
}) {
    const apps = axios.get('http://localhost:5001/api/applist').then(apps)

    return (
        <div>
            {apps.map((app) => {
                <li>{app.appType}{app.user}</li>
            })}
        </div>   
    )
}
